import React from "react";
import "./Navbar.css";
import CartWidget from "./CartWidget";
import { Link } from "react-router-dom";

const NavBar = () => {
    return (

            <Link to="/cart">
                <CartWidget className="icon-cart" />
            </Link>

    );
};

export default NavBar;
